import React, { useState, useEffect } from 'react';
import './ProductInfo.css'; // Custom CSS for additional styling

const Products = () => {
    const [agrochemicalProducts, setAgrochemicalProducts] = useState([]);
    const [organicProducts, setOrganicProducts] = useState([]);
    const [inorganicProducts, setInorganicProducts] = useState([]);
    const [isLoading, setIsLoading] = useState(false);
    const [error, setError] = useState(null);

    useEffect(() => {
        setIsLoading(true);
        Promise.all([
            fetch('https://api.shreejiinternationals.in/products/agrochemical').then(res => res.json()),
            fetch('https://api.shreejiinternationals.in/products/organic').then(res => res.json()),
            fetch('https://api.shreejiinternationals.in/products/inorganic').then(res => res.json())
        ]).then(([agrochemicalData, organicData, inorganicData]) => {
            setAgrochemicalProducts(agrochemicalData);
            setOrganicProducts(organicData);
            setInorganicProducts(inorganicData);
            setIsLoading(false);
        }).catch(err => {
            console.error('Error fetching products:', err);
            setError('Failed to load products. Please try again later.');
            setIsLoading(false);
        });
    }, []);

    if (isLoading) {
        return <div style={{ display: 'flex', justifyContent: 'center', paddingTop: '50px' }}>
            <div className="loader"></div> {/* Ensure you have CSS for the loader */}
        </div>;
    }

    if (error) {
        return <div>{error}</div>;
    }

    return (
        <div style={{ padding: '20px' }}>
            <h1>Products</h1>
            {agrochemicalProducts.length > 0 && (
                <>
                    <h2>Agrochemical Products</h2>
                    <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
                        {agrochemicalProducts.map(product => (
                            <div key={product._id} style={{ border: '1px solid #ccc', padding: '10px', width: '300px' }}>
                                <h3>{product.TechnicalName}</h3>
                                <img src={product.ChemicalStructure} alt={product.TechnicalName} style={{ width: '100%', height: 'auto' }} />
                                <p>CAS No: {product.CASno}</p>
                                <p>Packing: {product.Packing}</p>
                            </div>
                        ))}
                    </div>
                </>
            )}
            {organicProducts.length > 0 && (
                <>
                    <h2>Organic Products</h2>
                    <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
                        {organicProducts.map(product => (
                            <div key={product._id} style={{ border: '1px solid #ccc', padding: '10px', width: '300px' }}>
                                <h3>{product.TechnicalName}</h3>
                                <img src={product.ChemicalStructure} alt={product.TechnicalName} style={{ width: '100%', height: 'auto' }} />
                                <p>CAS No: {product.CASno}</p>
                                <p>Packing: {product.Packing}</p>
                            </div>
                        ))}
                    </div>
                </>
            )}
            {inorganicProducts.length > 0 && (
                <>
                    <h2>Inorganic Products</h2>
                    <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
                        {inorganicProducts.map(product => (
                            <div key={product._id} style={{ border: '1px solid #ccc', padding: '10px', width: '300px' }}>
                                <h3>{product.TechnicalName}</h3>
                                <img src={product.ChemicalStructure} alt={product.TechnicalName} style={{ width: '100%', height: 'auto' }} />
                                <p>CAS No: {product.CASno}</p>
                                <p>Packing: {product.Packing}</p>
                            </div>
                        ))}
                    </div>
                </>
            )}
        </div>
    );
};

export default Products;
